import React, { useEffect } from "react";
import './App.css';
import Hero from './components/hero';
import AOS from "aos";
import "aos/dist/aos.css";
import Animate from "./components/animate";

export default function App() {
  useEffect(() => {
    AOS.init();
    AOS.refresh();
  }, []);
  return (
   <div>
      <Hero />
      <Animate/>
      <Demo/>
   </div>
  )
};
